import React from 'react'

const name = 'John Doe';
const image1 = 'https://picsum.photos/200/300';
const image2 = 'https://picsum.photos/200/300';
const image3 = 'https://picsum.photos/200/300';
const image4= 'https://picsum.photos/200/300';
const links = 'https://www.w3schools.com';

const paraEdit={
  fontSize: '3rem',
  color: 'red',
  border: '2px solid blue',
  fontFamily: 'Monospace',
}

const img={
padding: '5px',
width: '400px',
height: '400px'
}

const App=()=>{
return(
<>
<p style={paraEdit} contentEditable= 'true'>What is your Name? {name} : What is you Age?</p>
<img style={img} src={image1} alt='image'/>
<a href={links}>
<img style={img} src={image2} alt='image'/>
</a>
<img style={img} src={image3} alt='image'/>


</>
)
}

export default App;
